import React, { useState } from 'react';
import './App.css';
import { AgGridColumn, AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

const App = () => {
  var mlb_item_order = ['Overall','AL','NL','C','1B','2B','3B','SS','LF','CF','RF','DH'];
  var aaa_item_order = ['Overall','INT','PCL','C','1B','2B','3B','SS','LF','CF','RF','DH'];

  let leagueAverages = require('../src/LeagueAvg.json')

    const [gridApi, setGridApi] = useState(null);
    const [gridColumnApi, setGridColumnApi] = useState(null);

    return (
        <div className="ag-theme-alpine" style={{ height: 600, width: 2000 }}>
            <AgGridReact
                rowData={mapOrder(leagueAverages.filter(leagueAverages => leagueAverages.league == 'MLB'), mlb_item_order, 'split')}>
                <AgGridColumn field="age" headerName="Age"></AgGridColumn>
                <AgGridColumn field="prospect_age" headerName="Prospect Age"></AgGridColumn>
                <AgGridColumn field="avg" headerName="AVG"></AgGridColumn>
                <AgGridColumn field="obp"></AgGridColumn>
                <AgGridColumn field="slg"></AgGridColumn>
                <AgGridColumn field="ops"></AgGridColumn>
                <AgGridColumn field="tm_ops"></AgGridColumn>
                <AgGridColumn field="woba"></AgGridColumn>
                <AgGridColumn field="babip"></AgGridColumn>
                <AgGridColumn field="avg_exit_velo"></AgGridColumn>
                <AgGridColumn field="exit_velo_90_plus"></AgGridColumn>
                <AgGridColumn field="exit_velo_100_plus"></AgGridColumn>
                <AgGridColumn field="swing_per"></AgGridColumn>
                <AgGridColumn field="swing_per_kzone"></AgGridColumn>
                <AgGridColumn field="chase_per"></AgGridColumn>
                <AgGridColumn field="chase_per_2k"></AgGridColumn>
                <AgGridColumn field="miss_per"></AgGridColumn>
                <AgGridColumn field="miss_chase_per"></AgGridColumn>
                <AgGridColumn field="gb_per_fb"></AgGridColumn>
                <AgGridColumn field="ab_per_hr"></AgGridColumn>
                <AgGridColumn field="ab_per_ubb"></AgGridColumn>
                <AgGridColumn field="ab_per_so"></AgGridColumn>
                <AgGridColumn field="gb_per"></AgGridColumn>
                <AgGridColumn field="ubb_per"></AgGridColumn>
                <AgGridColumn field="so_per"></AgGridColumn>
            </AgGridReact>
        </div>
    );

